  const upDate = () => {
    setTasks({id:1,task:'second',date:"2022/02/18"});
    console.log(tasks);
  }

  const aiueo = "aiueo";

  return (
    <>
    <table className="TaskList">
    <tr>
      <th>1</th><th>task</th><th>date</th><th>checked</th>
    </tr>
    <tr>
      <td>i</td><td>aiueo</td><td><button onClick={()=>{upDate()}}>click</button></td>
    </tr>
    </table>
    </>
  )
}


